import React from 'react';
import logo from './logo.svg';
import { BrowserRouter as Router, Route} from "react-router-dom"
import './App.css';
class Content extends React.Component {


	render(){
    return (
   <div className="header" id="myheader">
   <div className="inner_header">
    <div className="logo_container">
    <a href="index.html"><img class="logo" src="img/Logo.png" /> </a>
  </div>
  <ul className="navigation">
    <a href="index.html"><li style="font-size:120%"><strong>Home</strong></li></a>
    <a href="Page1.html"><li>Services</li></a>
    <a href="Page2.html"><li>FAQs</li></a>
    <a href="Page3.html"><li>Registration</li></a>
    <a><li><input type="text" placeholder="Search..."/></li></a>
  </ul>

</div>
</div>
  );
}

};


ReactDOM.render(
	<Content/>,
	document.getElementById('main')
	)
